          title: Crimsonite History
          author: Withered Forger
          pages:
          - '{"text":"It all began when one day, one of the miners found an interesting
            material. It was unlike anything I had ever seen before. Turns out he
            had gone a little too deep into the nether''s core. He brought me this
            material in awe. unable to identify the material, I headed to the "}'
          - '{"text":"","extra":["[\"\",{\"text\":\"Identifier. Once I had brought
            it to him, he \\nexamined it, and he then told me this. \\\"One of your
            men has found \"},{\"text\":\"Crimsonite\",\"color\":\"red\"},{\"text\":\",
            the rarest material in all of the nether.\\\" I was absolutely baffled.
            I had then gone to inform my men to mine in very similar places. Next
            thing you know,\",\"color\":\"reset\"}]"]}'
          - '["",{"text":"we have enough crimsonite to equip all of our men with the
            strongest gear the nether has ever seen. We couldn''t let GregLabs"},{"text":"\u2122
            or anyone else outside the nether see this material. Fortunately, our
            soldiers were able to defend against the humans/GregLabs\u2122,","color":"black"}]'
          - '{"text":"keeping this sacred material a secret. Unfortunately, The Wither
            King had fallen. Leaving the Nether leader-deprived. The soldiers decided
            to take over & become the new leaders of the nether. They grew indefinitely
            stronger. Stronger than The Wither King ever was."}'
          - '{"text":"","extra":["[\"\",{\"text\":\"Bad things followed with this.
